import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Habitica extends Component {
  render() {
    return (
      <div>
        <div className="text-center">
          <img
            src="https://vignette.wikia.nocookie.net/habitrpg/images/9/98/Health.JPG/revision/latest?cb=20180212114707"
            alt=""
            width="450"
          />
          <br />
          <Link className="btn btn-lg btn-primary">Home</Link>
        </div>
      </div>
    );
  }
}

export default Habitica;
